import React from 'react';

function ViewTodo({ todo }) {
    console.log(todo)

    return (
        <div>
            {
                todo.map((item, index) => {
                    <div key={index}>
                        <h2>{item.name}</h2>
                    </div>
                })
            }
        </div>
    );
}

export default ViewTodo;
